IF OBJECT_ID('dbo.proc_transform_452', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_452;
GO
CREATE PROCEDURE dbo.proc_transform_452
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_452
    SET payload = LEFT(payload, 1000) + N'|V4-452|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_452;
END
GO
IF OBJECT_ID('dbo.audit_v4_452', 'U') IS NULL
