    CREATE TABLE dbo.audit_v4_452 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_452;
